import React from "react";
import Content from "./Content";
import Info from "./info";

class navigationPanel extends React.Component {
    constructor(props) {
        super(props);
        this.state = {activePanel: "home"};
        this.changePanel = this.changePanel.bind(this);
    }

    changePanel(panel) {
        this.setState({activePanel: panel})
    }

    render() {
        return(
            <div className="page">
                    <div className="container-fluid">
                        <div className="row">
                            <div className="col-sm-2 navbar">
                                <nav className="navbar navbar-dark bg-inverse">
                                    <a className="nav navbar-nav" href="#">Меню</a>
                                    <ul className="nav navbar-nav">
                                        <li className="nav-item">
                                            <a onClick={this.changePanel({panel:"home"})} className="nav-link" href="#">Домой</a>
                                        </li>
                                        <li className="nav-item">
                                            <a onClick={this.changePanel({panel:"Profile"})} className="nav-link" href="#">Профиль <span className="sr-only">(current)</span></a>
                                        </li>
                                        <li className="nav-item">
                                            <a onClick={this.changePanel({panel:"tasks"})} className="nav-link" href="#">Задачи</a>
                                        </li>
                                        <li className="nav-item">
                                            <a onClick={this.changePanel({panel:"map"})} className="nav-link" href="#">Карта</a>
                                        </li>
                                    </ul>
                                </nav>
                            </div>

                            <div className="col-sm-2 leftcont">
                                <Info/>
                            </div>
                            <div className="col-sm-6 content">
                                <Content/>
                            </div>

                            <div className="col-sm-2">
                            </div>

                        </div>
                    </div>
            </div>
        );
    }
}

export default navigationPanel;
